import './index.css'

import PlayerGroup from "./PlayerGroup.js"
import Game from "./Game.js"


class Home extends React.Component {


    constructor(props) {
        super()
    }

    render() {

        return (
            <div>
                <Game/>
                <PlayerGroup position="LW,RW,C"/>
                <PlayerGroup position="D"/>
                <PlayerGroup position="G"/>
            </div>
        );
        }
}
  export default Home
